import "./Cell_styles.scss";
import React, { useState, useEffect } from "react";

const Cell = ({ cellClass, cellText, cellIndex }) => {
  const [checked, setChecked] = useState(false);
  const [broken, setBroken] = useState("");

  useEffect(() => {
    const cells = [document.querySelectorAll(".cell")];
    console.log(cells);
  }, []);

  return (
    <div
      className={`${cellClass} ${broken}`}
      onClick={() => {
        if (checked === false) {
          setChecked(true);
          const brokenTextureNumber =
            Math.floor(Math.random() * (2 - 1 + 1)) + 1;
          setBroken(`broken${brokenTextureNumber}`);
        } else {
          console.log("Already broken");
        }
      }}
    >
      <p className="cellIndex">{cellIndex}</p>
      <p className="cell_text">{cellText}</p>
    </div>
  );
};

export default Cell;
